INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/100, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ペコリーヌのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"プリンセスなプリンなの\nお店にあったいろんな食べもの\nを入れられるだけ入れてみたの\nどんな味なのか楽しみなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"おいしすぎて食べ始めたら\n止まらない最高のプリンなの\n今のミヤコを止められるヤツは\n誰もいないの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"やばいですね☆なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/1, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/101, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"コッコロのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"いつもオマエのそばに寄りそう\nヤツのぷりんなの。ミヤコの\nワガママもやさしく受け入れて\nくれそうなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"なんだかすごくやさしい気持ち\nになる味なの…\nおはようからおやすみまで\nずっと一緒な味なの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"主さま、なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/2, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/102, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"キャルのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"ツンツンデレデレなヤツの\nプリンなの。砂糖とスパイスを\n混ぜてみたの。どんな味になる\nか楽しみなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"いろんな味が一度で楽しめる\nプリンなの。ツンデレはプリン\nにするとおいしいの。ミヤコも\nツンデレを目指してみるの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ぶっ殺すぞ！なの！\n…デレデレはどこなの？", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/3, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/103, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"シェフィのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"オマエと同じで、一度赤ちゃん\nみたいになったヤツのプリン\nなの。ヒンヤリ、プリンアイス\nにしてみたの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"あったかいところで食べる\nプリンアイスは最高なの～♪\n安心しすぎて昔の記憶のない\nミヤコも心が子どもになるの～", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"おにーたん♪なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/4, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/104, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"イリヤのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"イリヤを見てたら思いついた\nトマトジュースが隠し味の\nプリンなの。栄養満点なの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"トマトで栄養補給も完璧なの\nどんどん力がみなぎってきて\n復活も夢じゃないの\nミヤコが復活したら…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ハーハッハッハ！\n世界征服なのじゃなのー！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/5, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/105, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"アカリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"アカリのプリンなの。ヨリと\n同じくらいかわいく作って\nやったの。正直ミヤコは\nおいしければなんでもいいの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"見た目がかわいくてもミヤコは\n味にも厳しいの。あむっ…\nこ、これは…！なんだかすごく\n変な気分になってきたの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"お兄ちゃんのエッチ！　なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/6, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/106, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ヨリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"かわいくつくらないとアカリが\n怒りそうだからヨリのプリンは\nかわいく作ったの。自信作なの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"んむぅ…これはなかなか感想が\n難しいプリンなの…率直に言い\nたいような…心のうちに秘めて\nおきたいような…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"えっと…その…あんたのこと…\nだ、大っ嫌いなのーー！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/7, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/107, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"シノブのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"シノブはいつもミヤコに\nやさしくしてくれるから\n丁寧に作ったの。ドクロ親父は\nいらないから作ってないの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"このプリンを食べるとシノブが\nミヤコの中にいるみたいなの！\nシノブの力があれば未来の\nプリンを見放題なの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"お父さん…\nいいかげんにしてなの！\nん？プリンの未来は…\n見えなかったの…", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/8, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/108, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ジュンのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"黒い鎧を脱がないヤツのプリン\nなの。固めのプリンを目指したら\nカチカチになりすぎたの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"固すぎてかじれないから丸吞み\nにしたの。なんだか体が硬く\nなった気がするの。みんなを\n守れる気がするの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"インフェルノシールド！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/9, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/109, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"トモのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"オマエをいっつもからかってる\nヤツのプリンなの\nちょっぴり変わったスパイスで\nからかいを表現したの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"口の中でスパイスがプチプチ\nはじけて新食感なの！\nプチプチがミヤコを\n翻弄するの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"あなたといると調子が狂うな\n…なの\n翻弄してたのはオマエなの？", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/10, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/110, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"マツリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"王宮騎士団にいるちっこいヤツ\nなの。ちっこいけどやるヤツ\nらしいから、濃いめの味付けに\nしてみたの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ん～見かけによらず濃厚な\nパンチのある味わいが\n口いっぱいに広がるの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"タイガーヒーローボンバー！\nなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/11, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/111, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"クロエのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"なんかすごくクールなプリンなの\nなんかテンションも少し\n低そうなの。これ\n食べちゃっても大丈夫なの？", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"クールな見た目なのにとっても\n優しい味なの！なんだか\n懐かしさを感じるの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ま、いいんじゃん？\nしらんけどなの", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/13, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/112, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"チエルのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"きれいにデコれたの！\nカラフルでおいしそうなの\nこれは期待できそうなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"なんか変わった食感なの…\nちゃる…ちょる…ちぇる？\nちぇるってしてるの\nでもちぇるってなんなの？", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ぷりーん★なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/14, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/113, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ユニのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"見た目は完ぺきなの！\nこれをつくったやつは\nきっと天才なの！\n早く食べたいの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"味はなんか妙に\n甘酸っぱいの…\n食べたことない味なの\nこの味ってもしかして…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"端的に換言すれば\n青春の味なの？", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/15, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/114, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"サレンのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"オマエから聞いた懐かしい\n味ってヤツを全部入れてみたの\nオマエ記憶がないのに懐かしい\nってどういうことなの？", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ミヤコも幽霊になる前の記憶\nがないのに、なんだか懐かしい\n気持ちになってくるの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"幼なじみはあんた…なの？", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/16, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/115, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"スズメのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"たまたま会ったメイドに教えて\nもらった作り方なの。メイドは\nプリンも作れるはずなの。\nなのにこの不安は何なの…？", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"おかしいの。このプリンを\n食べてから、３回も転んだの\nミヤコは幽霊だから転んだり\nしないの。なんでなの…？", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ひゃああんなの～！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/17, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/116, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"クルミのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"怖がりな子どもが教えてくれた\n小さくてかわいいプリンなの　\n触ってないのにぷるぷる震える\n驚きのやわらかさなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"甘さのなかに少しのしょっぱさ\nクセになる味なの\nこのプリンはがんばればきっと\nいろんな美味しいになれるの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"サルキデバレヤ！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/18, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/117, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"アヤネのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"くまのぬいぐるみを見ていたら\nひらめいたの。小さいけど\nしっかりした甘さの元気に\nなれるプリンなの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"このプリン、食べるとなんだか\nお姉ちゃんになった気分に\nなるの。ピンチのプリンは\nミヤコが守ってやるの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"プリンフルスイングなの～！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/19, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/118, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"マホのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"マホマホ王国って国にいる\nお姫様のプリンなの\n魔物も虜にしちゃう\nすてきなプリンなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"メルヘンパワーがあふれてきて\nいまならミヤコにも魔法が\n使える気がするの！\nほな、いきまひょ～なの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"みらくるみやりん\nくるりんぱ～☆なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/20, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/119, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"マコトのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"カッコいいプリンを目指して\nワイルドなものをガンガン\n入れてみたの。きっと熱い\nプリンができるはずなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"うおーん！ミヤコなんだか\n強くなった気がするの！\n困ったことがあればミヤコが\nまとめて面倒見てやるの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ウルフェンバイトなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/21, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/120, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"カオリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"どっかの国でよくとれる\nゴーヤーに似てるやつを\nいれてみたの！ちょっと\n苦いらしいけど…", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"一口食べたら元気が\nあふれて止まらないの！\n気分がいいから、一曲\n踊りでも披露してやるの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"なんくるないさ～！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/22, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/121, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"カスミのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"勘の鋭いやつが好きな食べ物を\nたくさん入れてみたの\n難しいこと考えるのにぴったり\nらしいけど、なんでなの？", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"むむむ…なるほどなの\n上質な糖分をふんだんに\n使うことで、脳をより活性化\nできるからなの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ふふん。簡単な推理なの", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/23, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/122, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"マヒルのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"搾りたての牛乳を\nたっぷり使ったプリンなの～\nマヒルに手伝ってもらって\nミヤコ直々に搾ってきたの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ミルクがとっても濃厚で\nほっぺたが落ちちゃうの～♪\nこのプリンからは牧場の…\n自然の息吹を感じるの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"エリザベス～！なの～！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/24, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/123, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"シオリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"マヒルからやさしいヤツだって\n聞いたの。やさしさを表現\nするために奥ゆかしい甘さに\n仕上げてみたの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ほのかな甘さでありながら\nしっかりとした主張も\n感じさせる\n味わい深いプリンなの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"私の好きな本…読んで\nもらえたらうれしいです…\nなの", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/25, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/124, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"リマのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"牧場にいるヤツらしいの\n牛とは違うらしいの\nもふもふ気持ちいいらしいから\n食感にこだわって作ったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"こ、これは…！口の中に入れた\n瞬間にふんわり溶けて\nなくなっちゃうの！\nその食感がやみつきなの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"もふもふにしてあげるなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/26, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/125, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"リンのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"いっつも寝てるやつらしいの\nぐっすり眠れる薬草をたくさん\n入れてみたの。プリンとして\nおいしくなるかはわからないの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"んむぅ…評価が難しい味なの…\nおいしいのはおいしいの…\nん～考えてたら…\n眠くなってきたの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"めんどくさいな～なの…", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/27, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/126, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ラビリスタのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"クレープ屋の真っ赤な人に\n教わったプリンなの\n作り方を丁寧に教えてくれて\nとっても優しい人だったの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"プ…プリンなのにクレープの味\nがするの。味もすごく普通なの\nでも…なんだかプリンの新しい\n扉を開けそうな気がするの…！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"プリンの権能を解放するの～！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/28, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/127, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"シズルのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"お店に落ちてた謎のレシピの\nプリンなの。レシピの表紙には\n『お姉ちゃんの愛情たっぷり』\nって書いてあったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"とろける食感が絶品なの～♪\n食べるとなんだか幸せな\n気持ちになれるの…これが\n愛情ってやつなの？", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"お姉ちゃんパワー全開！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/29, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/128, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"リノのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"リノから作り方を教わったの！\nさすがクレープ屋で働いてる\nだけあって美味しそうなの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"これで妹力？があがるらしいの。\n妹になればお兄ちゃんに\nプリンをたかり放題なの！\n最高なの～！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"お兄ちゃん、プリンをよこすの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/30, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/129, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ヒヨリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"プリンのレシピで悩んでたら\n通りすがりのおねーさんが\n一緒に考えてくれたプリンなの\nいいヤツもたまにはいるの～♪", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"食べたら元気が湧いてくるの\nだからプリンのレシピのお礼に\nミヤコも人助けを手伝って\nやったの。ミヤコはえらいの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"困った時はお互いさまさま！\nなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/31, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/130, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ユイのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"ミヤコががんばって作った\nこだわりのプリンなの～\nプリンは癒しなの。だから優しい\n気持ちで丁寧に作ったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"はっ…思わずお花畑が見えたの\n身も心も包まれるような\nとっても優しい味がするの\nこれは…まさに癒しなの～♪", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"フラワリングヒールなの～♪", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/32, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/131, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"レイのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"究極のプリンを作るため\nミヤコは厳しい修行をしたの…\nその結果あって完成した\nクールで完璧なプリンなの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"確かに完璧なプリンなの\nでも究極のプリンと呼ぶには\nまだまだ修行が必要なの…\nプリン作りは奥が深いの…！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"スラッシュテンペスト！なの。", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/33, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/132, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"アキノのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"豪華で高級な\nお嬢様プリンなの\n中には宝石みたいな\n大きいイチゴを入れるの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"味にも素材にもこだわりが\nあるの。一流は妥協しないの\nもっと豪華に、もっとおいしく\nできるはず…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"おーほっほほほ！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/34, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/133, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ユカリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"外はしっかり、中はふわとろの\nプリンにするの\n泡みたいなしゅわしゅわの\n生クリームも入れるの♪", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"プリンは飲み物とも言うの\nぐいっていってみるの\n…ふわしゅわでとろけるの～！\n体に染みわたるの～", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"プリしゅわ最高～！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/35, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/134, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"タマキのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"餡子を入れて\nオーブンでこんがり焼くの\nたい…焼きプリンなの\n斬新なの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"このプリンは焼きたてのうちに\n食べるのが一番なの…！\n熱いけどおいしくて\nうずうずしてきたの…！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"にゃにゃにゃ！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/36, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/135, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ミフユのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"栄養バランスを考えて\n木の実をたくさん入れるの\nあれこれ忙しいときでも\n頼りになるプリンなの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"プリンはいつでも手軽に\n食べられるのも魅力なの\nこれは食べ応えもあるから一つ\n食べればいっぱい動けるの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"効率全開！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/37, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/136, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ミサトのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"エルフの森で子どもにもらった\n薬草を使って作ったの\nこんな優しい味のプリンは\n初めてなの…", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"このプリンを食べてから\nいい子になった気がするの\n大好きなプリンを泣いてる子に\nあげたの。いい気分なの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"あらあら～なの～♪", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/38, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/137, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ハツネのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"お昼寝でみた夢の中に\nでてきた不思議なプリンを\n作ってみたの。見てたらまた\n眠くなってきたの…", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"あまいプリンが口の中で\nぽんぽん弾ける未知の味なの！\n今なら不思議な力で世界も\n救えそうなの！でも眠くなるの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"スヤスヤ～…なの…", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/39, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/138, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"アオイのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"お店のはしっこに一つだけ\n残ったおもちゃを見て思い\nついたの。他のプリンと一緒に\n置いておくと震えだすの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"知らないうちにはしっこに\n隠れちゃってたの。食べたら\nミヤコ、シノブたちに会いに\nいきたくなってきたの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ぼっちは卒業なの～！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/40, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/139, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ノゾミのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"トップオブアイドルの\nプリンなの。キラキラした\nものを入れて、あつ～い\nオーブンで焼いてみたの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"口の中に華やかな甘さが\n広がる…これがアイドルなの？\n急に歌って踊りたく\nなってきたの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"リズムあげるのー！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/41, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/140, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"チカのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"ミヤコにプリンをくれるすごく\nいいヤツのプリンなの\n精霊に呼びかけながら\n一生懸命かき混ぜたの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"プリンの生地がとっても\nなめらかで最高の舌触りなの！\n精霊、ミヤコのプリンのために…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"風の加護を！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/42, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/141, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ツムギのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"歌って踊って衣装も作れるヤツ\nのプリンなの。このプリンは\nきれいに包装するの。プリンを\n最高の形で着飾らせるの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"包装は食べるまでの手間が\n増えてめんどくさいの。でも\nそのめんどくささもプリンの\n味を引き立てるの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"騎士さんのために\nしたんじゃありません！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/43, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/142, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"クリスティーナのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"プリンをくれないならどうでも\nいいヤツなの。でも横で\nいろいろ言ってきたから\nがんばって作ったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"んむっ！？\nく、口のなかでプリンの\nおいしさが大暴れなの！\n止まらないの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"宴の始まりなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/12, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/143, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ルカのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"大人な甘さ控えめのプリンを\n作るの。試しにお魚を入れて\nみるの。プリンの可能性は\n無限大なの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"大人の味なの。今やミヤコは\nみんなの頼れる姐御なの！\n悪さするやつはミヤコが\n許さないの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"一刀両断、覚悟しな！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/44, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/144, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ナナカのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"サイカワサイツヨな\n魔法のプリンなの\n中身をカラフルにするの～\n甘いプリンは頭が冴えるの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"一口食べる度に味が変わって\n魔法みたいなの！\nもしかして全部食べたら\nミヤコも魔法少女になれるの？", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"きゅぴーん！キタコレ！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/45, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/145, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"アンナのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"小難しい言葉をささやきながら\n作ったら魔力あふれるプリンが\n爆誕したの！でも、不思議と\nイタイタしいのはなぜなの～？", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"一口食べたら謎の組織に\n狙われたり、前世の記憶が蘇る\n気がするの～設定盛りすぎなの\nミヤコは、ミヤコは…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"人呼んで、疾風のミヤコなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/46, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/146, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"エリコのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"甘酸っぱい赤い木の実を\n切り刻んで入れるの\n甘くてちょっぴり刺激的な\nヤンデレのプリンなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"なんか普通のプリンよりも\nいい匂いがするの～…\nプリンのことがもっともっと\n好きになっちゃうの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"クスクス…クスクスクス…なの", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/47, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/147, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ミツキのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"健康に気を遣うミヤコは\nプリンにお薬を入れてみたの～\nでもなんだか毒々しいから\n彩りにバラを添えてみたの～", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"鼻に抜ける薬のにおいがアレ\nだけど大人っぽくて頭が\nよくなった気がするの。無性に\n実験したくてしかたないの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"どんなプリンも\nミヤコの隻眼からは\n逃れられないの～！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/48, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/148, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"モニカのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"小さいけどしっかりした\n軍人のプリンなの\nちょっと固めにして\n砂糖はいっぱい入れるの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ん～王道なプリンは\n甘くて安定したおいしさなの～\n思わず笑顔になっちゃうの\nにこにこなの～♪…はっ！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"私は子どもではない！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/49, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/149, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ニノンのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"オーエド町で手に入れた素材と\nトーゴクに伝わる術をかけて\nプリンを作るの。シュババ！\n忍法隠し味の術なの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"このプリンを食べてから\n誰かにお仕えしなきゃ\nいけない気がするデースなの\nそれはショ、ショー…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ショーグン！　ミヤコと一緒に\n天下統一するデースなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/50, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/150, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"クウカのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"オマエが持ってきた手錠を\nヒントに作ったプリンなの\nプリンが動けないように\nカチカチに固めたの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"カチカチに固めたせいで食感が\nプリンのようで\nプリンじゃないの…でもこの\nもどかしさが癖になるの…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"…ぐふふ、じゅるり～なの", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/51, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/151, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ユキのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"とっても美しいプリンなの\n美しいものを手当たり次第\n入れたらすごいことになったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"味も美しい以外の感想が\n出てこないの。ていうかこれを\n食べたミヤコも美しいの！\n鏡、鏡はどこなの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"あぁ、ミヤコはなんて美しいの～", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/52, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/152, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"アユミのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"知らないうちにお菓子が売れた\n時に思いついたプリンなの。\n作り方もよく覚えてない…\nけど、きっとおいしいの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"うん、やっぱりおいしく…\nん？あそこにいるのは\nアイツなの。あれ？\n体が勝手にアイツの方に…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ジー…ってミヤコなにしてるの\nミヤコはストーカーじゃないの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/53, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/153, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ミソギのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"イタズラ好きの手下と一緒に\n作ったプリンなの。見た目は\nかわいいけど、作り方は\n意外と複雑なの～", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"見た目通り甘々で優しい味なの\nでも、レシピを見たら裏面に\n別の作り方が書いてあるの。\nこれだと激辛プリンに…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"にひひ…イタズラの時間なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/54, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/154, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ミミのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"素直でやさしい手下と一緒に\n動物のぬいぐるみをいっぱい\n並べて作ったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ん～、ふわふわの甘々なの！\nなんだか楽しくなって\n心も体もるんたったしてくるの", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ぴょんぴょこぴょーん、なの♪", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/55, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/155, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"キョウカのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"幽霊を怖がっている手下と\n一緒に作ったプリンなの。\n小さいクセにきっちりしてて\nとってもかわいいプリンなの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ひんやりしてて暑い日でも\nおいしく食べられそうなの！\nん？これを買いたい大人が\nいる？それって…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"へんたいふしんしゃさんなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/56, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/156, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"スズナのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"カリスマモデルなプリンなの\nモリモリにデコレーションして\nカリスマ感を演出したの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"見て食べて楽しめる新機軸の\nプリンなの。ミヤコは幽霊\nだけど自分の足でランウェイを\n歩きたくなってきたの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ハート狙い撃ち！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/57, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/157, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"イオのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"学校の先生をしてるヤツの\nプリンなの。お堅くしようと\nしたら、いつの間にか色っぽく\nなっちゃったの。なんでなの？", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"プ、プリンは全部ミヤコのもの\nなのに、なんだかこのプリンは\nいろんな人に教えたく\nなっちゃう不思議な味なの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"授業を始めます♪なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/58, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/158, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ミサキのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"少し背伸びしたおませな子を\n表現したプリンなの。あえて\n甘さ控えめなの。カラメルは\n後乗せできるから安心するの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"ミヤコはプリンならどんなもの\nでも食べるの。でもカラメルを\nちょっとだけ足すの。\nちょっとだけなら…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"立派なレディ、なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/59, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/159, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ホマレのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"謎に包まれたプリンができたの\n何か隠してるようなの…\nこれは危険なプリンなの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"味はすごいゴージャスなの！\nボスの風格があるの！\nビッグなミヤコに\nプリンを捧げるの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"プリンを持ってこないと\nお仕置きだよ～☆なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/60, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/160, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"カヤのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"ワイルドな見た目なの！\nこれは期待できそうなの。\nきっと躍動感あふれる味なの！", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"最初の一口目が\nすごいインパクトなの！\n無性にケンカしたくなるの！\nプリンをよこせなの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"たぎってきたの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/61, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/161, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"イノリのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"なんか見た目がパッとしないの\nこれほんとに大丈夫なの？\nなんか頼りないの…", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"見た目はアレだけど味はおいし\nいの…あと主張もはっきりして\nるの！やる気と自信だけは\n出てきたのうおおおーなの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"下剋上、やってやるですなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/62, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/0);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/162, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ムイミのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"天下の大悪党のプリンなの\nこれまでのジョーシキに\n捉われないプリンを\n作ってみたの～", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"むむむ…食べたら\nやる気が湧いてきたの！\nミヤコを邪魔するやつはみんな\nまとめてぶっ飛ばしてやるの～", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"どけどけ～！なの～！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/63, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/163, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"ネネカのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"いろんなものに変身したり\n分身したりできるヤツの\nプリンなの。型で同じプリンを\nたくさんたくさん作ったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"いつのまにか作ったの全部\n食べちゃったの。なんで\nプリンは分身しないの？\n無限に増えろなの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ミラーミラー！なの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/64, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/164, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"クレジッタのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"金の亡者のプリンなの\n金にものを言わせて作って\nみたの。おばあちゃんの\nプリンと対極なの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"むぅ…認めたくないけど\nおいしいの…これを何個も\n作れるほどのお金を稼ぐのは\n大変なの…でもおいしいから…", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"プリンに忠誠を誓いますわ！\nなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/65, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
INSERT INTO `v1_2e2a60f0e715759c1167fc81fee07e8efc742db68a0dd3b3bed59db7197f37b3` VALUES (/*84ee72ca776c1fe5d732b0dd9da2a4b000568d14a8ee8c71f615472261ea9f62*/165, /*c74da17d12f93184ba9aeac4ea172b6b2377912eaa5ea49098417c4c3c80ca7b*/3, /*9f302b36b847ff3c248a973049349cf6699d393d373dc1a036c1b9f712c18041*/5, /*9dfa6b1890131e8803e99f46adadab1c43885e884ac29f4644dfae49b31abff4*/"カリンのプリン", /*7329d8575acf340b385b929af7b4fb4679523aee771f6efb4c76b85d32f943bf*/"みんなお世話になるギルド\n管理協会職員のプリンなの\nお役所感を出すために手堅く\n王道に作ったの", /*09ffa71672032cb085f9e0f3c5099983d6f72f2e37a52b6fbf5064c9f70b186e*/"手堅い…！手堅いの…！\n隙のないプリンなの！\n今のミヤコなら完璧な\n書類作成ができそうなの！", /*cb7c84003ff8bd8012523a868c6a0f8ddb5477f72d1bef41c47340c9090e3021*/"ギルド管理協会へようこそ！\nなの！", /*257a5d75fd81392eab8e3e4383e2fb67ddc62e050a19bc49357990ddf63bb2be*/66, /*9efee6f9f76d5f764f66881e3937c98db3e332a9c9382fad50162fea4e2ff280*/1);
